import React from "react";
import CongressPersonDisplay from "./components/congressPersonDisplay";
import MapDisplay from "./components/map";
import { getButtons } from "./components/fetch_data_functions";
import "./App.css";

function App() {
  return (
    <div
      onClick={() =>
        getButtons(116).then(data => {
          console.log(data[0]);
        })
      }
    >
      Hello.
    </div>
  );
}

export default App;
